import React from 'react'
import { NavLink } from 'react-router-dom'

const Navbar = () => {
  return (
    <>
    <NavLink to='/'>Food App</NavLink>
    <NavLink to='/todolist'>Todo List</NavLink>
    <NavLink to='/weather'>Weather</NavLink>
    </>
  )
}

export default Navbar
